import styled from 'styled-components'
import { CloseBlackButton } from './buttons/index'

const Tab = styled.div`
    width : 300px;
    height : 50px;
    background: rgba(4, 4, 4, 0.7);
    backdrop-filter: blur(25px);
    position : fixed;
    border-radius: 40px;
`
const Toast = ({child}) => {
    return(
        <Tab>
            <CloseBlackButton>
            {child}
            </CloseBlackButton>
        </Tab>
    )
}

export default Toast;
